comment: |-
  SELECT professional_id,
         last_name,
         cell_number
  FROM Professionals
  WHERE state = 'Indiana'
  UNION
  SELECT T1.professional_id,
         T1.last_name,
         T1.cell_number
  FROM Professionals AS T1
  JOIN Treatments AS T2 ON T1.professional_id = T2.professional_id
  GROUP BY T1.professional_id
  HAVING count(*) > 2

